COPY main (h1, content, node_id) FROM stdin;
База данных недвижимости. Работа с прайсом между риелторами города Нижнекамска.	<p><strong>nkagent.ru</strong> - ресурс предназначен для обмена данными между риелторами. Прайс разделён на три секции:</p>\r\n<p style="padding-left: 30px;">1. Комнаты, квартиры, изолированные малосемейки.</p>\r\n<p style="padding-left: 30px;">2. Дома, коттеджи, дачи, участки.</p>\r\n<p style="padding-left: 30px;">3. Коммерческая недвижимость.</p>\r\n<p>Работа с прайсом возможна после регистрации и только после открытия прав администратором на просмотр, скачивание и редактирование прайса. В данный момент проект тестируется, дописываются некоторые незначительные возможности взаимодействия с базой данных. Основные действия с прайсом доступны, такие как:</p>\r\n<p style="padding-left: 30px;">Самостоятельное редактирование в личном кабинете всех своих данных, <strong>можно поменять почтовый ящик на новый</strong>.</p>\r\n<p style="padding-left: 30px;">Добавление, правка, удаление объектов недвижимости.</p>\r\n<p style="padding-left: 30px;">Просмотр, поиск, сортировка, скачивание прайса в формате Excel.</p>\r\n<p style="padding-left: 30px;">Подготовка к скачиванию прайса, а именно расширенная сортировка по всем параметрам недвижимости, включение отключение столбцов в прайс.</p>\r\n<p style="padding-left: 30px;">Предусмотрена возможность модератору агенства редактировать не только свои объекты недвижимости, но и объекты других риелторов этого агенства.&nbsp;<strong>В разделе Прайс все риелтора видят все объекты недвижимости всех риелторов.</strong></p>\r\n<p style="padding-left: 30px;">Отправка сообщений в личном кабинете администратору проекта либо программисту.</p>\r\n<p style="padding-left: 30px;">Написание статей на тему Недвижимость с возможностью указания одной ссылки на сторонний сайт.</p>\r\n<p style="padding-left: 30px;">Удаление личного кабинета со всеми объектами недвижимости.</p>\r\n<p>После тестирования в проекте nkagent.ru смогут участвовать агенства и риелторы других городов. Список всех кто в данный момент может в полном объёме взаимодействовать с прайсом указан в разделе Агенства.</p>\r\n<p>Весь ресурс написан одним программистом с нуля - самописный. Не используются&nbsp;распространённые движки CMS. Не используется форма регистрации сторонних приложений, пароли в базе данных шифруются - скрыты от всех. Находится движок проекта на выделенном сервере с использованием серверной технологии <strong>nodejs</strong>. Высокопроизводительная и надёжная база данных <strong>PostgreSQL.&nbsp;</strong>Предложения и замечания отправляйте в личном кабинете, будут рассмотрены и включены в работу, ошибки любой сложности в короткие сроки исправлены.</p>\r\n<p>P.S. Программист проекта будет признателен всем кто взломает движок проекта, уронит сервер, уничтожит базу данных. Пожалуйста сообщите об уязвимости mail @ nkagent.ru .&nbsp;</p>\r\n<p style="padding-left: 30px;">&nbsp;</p>\r\n<p style="padding-left: 30px;">&nbsp;</p>	4209
\.
